import React from 'react';
import CanvasJSReact from './canvas.js/canvasjs.react';

var CanvasJSChart = CanvasJSReact.CanvasJSChart;

class amountChart extends React.Component {
	constructor() {
		super();
		this.toggleDataSeries = this.toggleDataSeries.bind(this);
	}


	toggleDataSeries(e){
		if (typeof(e.dataSeries.visible) === "undefined" || e.dataSeries.visible) {
			e.dataSeries.visible = false;
		}
		else{
			e.dataSeries.visible = true;
		}
		this.chart.render();
	}

	render() {

		const aldatas = this.props.data
		const covot = this.props.formData.covot

		for(var i=0; i < aldatas.length; i++)
		{
			for(var j=0; j < covot; j++)
			{
				if(j == aldatas[i][2])
				{
					console(aldatas[i][2])
				}
			}
		}






		const options = {
			animationEnabled: true,
			title:{
				text: covot + " hesegt huvaav"
			},
			axisX: {
				title:this.props.formData.coordinatX
			},
			axisY:{
				title:this.props.formData.coordinatY
			},
			data: [{
				type: "scatter",
				toolTipContent: "<span style=\"color:#4F81BC \"><b>{name}</b></span><br/><b> Load:</b> {x} TPS<br/><b> Response Time:</b></span> {y} ms",
				name: "Server Pluto",
				showInLegend: true,
				dataPoints: [
					{ x: 23, y: 330 },
					{ x: 28, y: 390 },
					{ x: 39, y: 400 },
					{ x: 34, y: 430 },
					{ x: 24, y: 321 },
					{ x: 29, y: 250 },
					{ x: 29, y: 370 },
					{ x: 23, y: 290 },
					{ x: 27, y: 250 },
					{ x: 34, y: 380 },
					{ x: 36, y: 320 },
					{ x: 33, y: 405 },
					{ x: 32, y: 453 },
					{ x: 21, y: 292 }
				]
			},
			{
				type: "scatter",
				name: "Server Mars",
				showInLegend: true, 
				toolTipContent: "<span style=\"color:#C0504E \"><b>{name}</b></span><br/><b> Load:</b> {x} TPS<br/><b> Response Time:</b></span> {y} ms",
				dataPoints: [
					{ x: 19, y: 200 },
					{ x: 27, y: 300 },
					{ x: 35, y: 330 },
					{ x: 32, y: 190 },
					{ x: 29, y: 189 },
					{ x: 22, y: 150 },
					{ x: 27, y: 200 },
					{ x: 26, y: 190 },
					{ x: 24, y: 225 },
					{ x: 33, y: 330 },
					{ x: 34, y: 250 },
					{ x: 30, y: 120 },
					{ x: 37, y: 153 },
					{ x: 24, y: 196 }
				]
			}]
		}


		return (
		<div>
			<CanvasJSChart options = {options} onRef={ref => this.chart = ref}/>
		</div>
		);
	}

}

  export default amountChart;
